import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import './plantilla/css/open-iconic-bootstrap.min.css'
import './plantilla/css/animate.css'
//import './plantilla/css/owl.carousel.min.css'
import './plantilla/css/owl.theme.default.min.css'
import './plantilla/css/magnific-popup.css'
import './plantilla/css/bootstrap-select.css'
import './plantilla/css/aos.css'
import './plantilla/css/ionicons.min.css'
import './plantilla/css/bootstrap-datetimepicker.min.css' // cambie una url
import './plantilla/css/nouislider.css'


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
